<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":3321483,"title":"Titanic Analysis with R(rf,xgb)","forkParent":null,"currentRunId":12050244,"mostRecentRunId":12257934,"url":"/pyy0715/titanic-analysis-with-r-rf-xgb","tags":[],"commentCount":0,"upvoteCount":0,"viewCount":93,"forkCount":1,"bestPublicScore":null,"author":{"id":2508358,"displayName":"pyy0715","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"pyy0715","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/2508358-kg.jpg","profileUrl":"/pyy0715","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":0,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2019-03-25T14:35:03.4166667Z","selfLink":"/kernels/3321483","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":44968,"writeGroupId":44969,"slug":"titanic-analysis-with-r-rf-xgb"},"kernelBlob":{"id":235670064,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"notebook","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"{\u0022cells\u0022:[{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002232c0c53cc9a41a8c2b73fd99403dc1be6fbe55d1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 타이타닉 분석\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022623bb09ab6e2734626a634acd8f55212d6aada9e\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 1. 소개\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022273f08d50d7921171ee8b24eb64d205abade5355\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 1.1 데이터 설명\\n* train.csv : 예측 모델을 만들기 위해 사용하는 학습 데이터다. 탑승객의 신상정보와 생존유무가 주어진다. \u003cbr /\u003e\\n* test.csv - 학습 데이터에서 신상정보 및 파생변수를 토대로 모델을 만들고 test.csv파일을 이용하여 생존유무를 예측한다. \u003cbr /\u003e\\n* sampleSubmission.csv - 제출시 사용하는 csv 파일이다. \u003cbr /\u003e\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022d14342756597070188502f7db172c60a0de7a2ce\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 1.2 변수 설명\\n* survival : 생존유무, target 값. (0 = 사망, 1 = 생존) \u003cbr /\u003e\\n* pclass : 티켓 클래스. (1 = 1st, 2 = 2nd, 3 = 3rd) \u003cbr /\u003e\\n* sex : 성별 \u003cbr /\u003e\\n* Age : 나이(세) \u003cbr /\u003e\\n* sibsp : 함께 탑승한 형제자매, 배우자 수 총합 \u003cbr /\u003e\\n* parch : 함께 탑승한 부모, 자녀 수 총합 \u003cbr /\u003e\\n* ticket : 티켓 넘버 \u003cbr /\u003e\\n* fare : 탑승 요금 \u003cbr /\u003e\\n* cabin : 객실 넘버 \u003cbr /\u003e\\n* embarked : 탑승 항구\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022a7d420e4ee4bfe8ab7abaa5bc4647a3937fbad6d\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 2. 준비작업\\n### 2.1 Packages\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00228caff423bee5b454f305b21b0556316f9c2c6c31\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022library(readr)\\nlibrary(stringr) # 문자열 처리 패키지\\nlibrary(doBy)\\nlibrary(ggplot2)\\nlibrary(scales)\\nlibrary(RColorBrewer)\\nlibrary(corrplot)\\nlibrary(doBy)\\nlibrary(dplyr) # 전처리\\nlibrary(randomForest)\\nlibrary(gridExtra)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002296514bf54e68ae0c8894bec7fb049a57ad862edc\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 2.2 Loading the data\\n\\nread.csv()보다 readr 패키지의 read_csv()가 조금 더 빨리 데이터를 읽어온다는 장점이 있다.\u003cbr /\u003e\\n그러나 read_csv()는 stringsAsFactors 옵션이 없어서 문자열(Character)과 요인(Factor)를 구별하지 못하고 모두 Character로 불러온다.\u003cbr /\u003e\\n\\n추가적으로 R에서 기본 내장함수 rbind()는 두 데이터의 차원이 같을 때 병합할 수 있는데 test셋에는 Y값이 없어서 차원이 다르다.\u003cbr /\u003e\\n이에 따라 dplyr::bind_rows()를 사용하여 test데이터의 Y값은 NA처리하며 병합한다.\\n\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002292e3eb150e2f8908288fa665e2746ed0436368a5\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train \u003c- read_csv(\u0027../input/train.csv\u0027)\\ntest \u003c- read_csv(\u0027../input/test.csv\u0027)\\nfull \u003c- bind_rows(train, test)\\n\\nfull \u003c- full %\u003e% # ticket과 cabin은 파생변수 생성을 위해 문자열로 놔둠\\n  mutate(Survived = factor(Survived),\\n         Pclass   = factor(Pclass, ordered = T),\\n         Name     = factor(Name),\\n         Sex      = factor(Sex),\\n         Embarked = factor(Embarked))\\n\\nstr(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022e7726ede378c3e7aaf72f6dd5e15a66c830249ff\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 3. 탐색적 데이터 분석(EDA)\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002254067df41b04f87aaafab2630ed4f2dd9120e5c1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.1 수치값을 활용한 data 확인\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221716a1d121ac811f36a1ce68849818170a0c71b6\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022head(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022fc65cab4badfdc75cbff4ca6c7503a1c06e68bc2\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022str(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022e7802a353a3e3258103e9bf13f289be8b2764a8c\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022summary(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00225c809ef81baa11e2a96f3d8ff6b21b08372707d2\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u00221. 사망자가 생존자보다 많다 \u003cbr /\u003e\\n2. 남성이 여성보다 2배 가까이 더 많다 \u003cbr /\u003e\\n3. SibSp의 3분위값이 1이므로 대부분 부부끼리 혹은 형제끼리 탑승했다 \u003cbr /\u003e\\n4. Parch의 3분위수가 0이므로 부모나 자녀와 함께 탑승한 승객이 많지 않다 \u003cbr /\u003e\\n5. Fare의 최대값이 512로 이상치가 아닌지 확인이 필요해 보인다 \u003cbr /\u003e\\n6. 결측치가 많은 데이터임을 확인할 수있다. \u003cbr /\u003e\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00222700a6ddfc06bf0c130c2c9c2bed407b244b68f5\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022sapply(train, function(x) length(unique(x)))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00221788d9cb2afed26ec29d8b780f73f4b1b481972d\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.2 결측치 확인 및 시각화\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022fa443208accede539ac696e3a54366e275a10fed\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022colSums(is.na(full))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226d34c768a25971ddfa841037602849fe7846ed20\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values \u003c- full %\u003e%      # 결측치 비율을 데이터프레임으로\\n  dplyr::summarize_all(funs(sum(is.na(.))/n()))\\n\\n# tidyr::gather()함수를 이용하여 stack화 시킴 (설명변수들이 key로 지정한 변수에 나열되고, 결측값들이 value로 지정한 변수의 값으로)\\nmissing_values \u003c- tidyr::gather(missing_values,\\n                                key = \\\u0022feature\\\u0022, value = \\\u0022missing_pct\\\u0022)\\nmissing_values\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022533983cdd85c248b09b26920bdbd211b90753ef7\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values %\u003e% \\n  ggplot(aes(x = reorder(feature, missing_pct), y = missing_pct)) + # 정렬을 위한 reorder() 축지정\\n  geom_bar(stat = \\\u0022identity\\\u0022, fill = \\\u0022red\\\u0022) +  # bar plot 그리기 stat = \u0027identity\u0027 데이터프레임 값을 그대로 이용하여 그리라는 옵션\\n  ggtitle(\\\u0022Rate of missing values in each features\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022)) +\\n  labs(x = \\\u0022Feature names\\\u0022, y = \\\u0022Rate\\\u0022) +  # x,y축 제목 지정\\n  coord_flip() # Plot의 x, y축 변환 \\n\\n# 결측값이 있는 변수로만 시각화\\nmissing_values \u003c- missing_values[missing_values$missing_pct \u003e 0, ]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022a7c5826356713fd97563379cd8f2a94296575c7d\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values \u003c- missing_values[missing_values$missing_pct \u003e 0, ]\\n\\nmissing_values %\u003e% \\n  ggplot(aes(x = reorder(feature, missing_pct), y = missing_pct)) + # 정렬을 위한 reorder() 축지정\\n  geom_bar(stat = \\\u0022identity\\\u0022, fill = \\\u0022red\\\u0022) +  # bar plot 그리기 stat = \u0027identity\u0027 데이터프레임 값을 그대로 이용하여 그리라는 옵션\\n  ggtitle(\\\u0022Rate of missing values in each features\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022)) +\\n  labs(x = \\\u0022Feature names\\\u0022, y = \\\u0022Rate\\\u0022) +  # x,y축 제목 지정\\n  coord_flip() # Plot의 x, y축 변환 \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00226651581fb95a6ce478e96b3cd3238979192da708\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.3 변수 EDA\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022649f5e37c9bb0eb585d2be407f2284d67777c234\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.1 Sex\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002267f938cbc34617f041f75174415e93800dc7e6f3\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$Sex)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226ebd48f3ec7bdf8e66354636788e5f1df5d9cdb3\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full %\u003e% group_by(Survived, Sex) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00225e95070d23b8b2f6feb6293751995541e270b70a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(full$Sex,full$Survived),1) #여자들이 생존할 확률이 높음\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002202c28c80403f5646b4f84a20761034a595d4cf6a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 성별 막대그래프\\nsex.p1 \u003c- full %\u003e% \\n  dplyr::group_by(Sex) %\u003e% \\n  summarize(N = n()) %\u003e% \\n  ggplot(aes(Sex, N)) +\\n  geom_col() +\\n  geom_text(aes(label = N), size = 5, vjust = 1.2, color = \\\u0022#FFFFFF\\\u0022) + \\n  ggtitle(\\\u0022Bar plot of Sex\\\u0022) +\\n  labs(x = \\\u0022Sex\\\u0022, y = \\\u0022Count\\\u0022)\\n\\n# 성별에 따른 생존률 막대그래프\\nsex.p2 \u003c- full%\u003e%\\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(factor(Sex), fill = factor(Survived))) +\\n  geom_bar(position = \\\u0022fill\\\u0022) + \\n  scale_y_continuous(labels = percent) +\\n  scale_fill_brewer(palette = \\\u0022Set1\\\u0022) +  # palette에 어떤색 넣을지 지정\\n   # 일정한 간격으로 x축과 y축 설정 : scale_x_continuous(breaks=seq())\\n  # 분석가 마음대로 x축과 y축 설정 : scale_x_continuous(breaks=c())\\n  ggtitle(\\\u0022Survival Rate by Sex\\\u0022) + \\n  labs(x = \\\u0022Sex\\\u0022, y = \\\u0022Rate\\\u0022)\\n\\ngrid.arrange(sex.p1,sex.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00229904db658f1b0414a133b15916946b43b0fd5bf4\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.2 Pclass\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223ec75b82d676c0646a50874e1523a879ee968763\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$Pclass)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c35146d06f00948f13ad927530a273b070aff355\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(full$Pclass,full$Survived),1) # 더 좋은 객실 이용자일수록 생존할 확률이 높음\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00220b24ec440aa5006bae11f781cbd3bee5ec5fa79a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# Pclass 막대그래프\\npclass.p1 \u003c- full %\u003e% \\n  dplyr::group_by(Pclass) %\u003e% \\n  summarize(N = n()) %\u003e% \\n  ggplot(aes(Pclass, N)) +\\n  geom_col() +\\n  geom_text(aes(label = N), size = 5, vjust = 1.2, color = \\\u0022#FFFFFF\\\u0022) + \\n  ggtitle(\\\u0022Bar plot of Pclass\\\u0022) +\\n  labs(x = \\\u0022Pclass\\\u0022, y = \\\u0022Count\\\u0022)\\n\\n# Pclass에 따른 생존률 막대그래프\\npclass.p2 \u003c- full%\u003e%\\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(factor(Pclass), fill = factor(Survived))) +\\n  geom_bar(position = \\\u0022fill\\\u0022) + \\n  scale_fill_brewer(palette = \\\u0022Set1\\\u0022) +  \\n  ggtitle(\\\u0022Survival Rate by Pclass\\\u0022) + \\n  labs(x = \\\u0022Pclass\\\u0022, y = \\\u0022Rate\\\u0022)\\n\\ngrid.arrange(pclass.p1,pclass.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022cba644f5b2c83dafb3d048143ec6ba5a4f7d59c7\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.3 Fare\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221ed4e810e01eb836b000b9a51d580bd524260fac\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022hist(full$Fare)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c626947f9d91f9863323fd74c82261dab61ddbc8\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# fare 히스토그램\\nFare.p1 \u003c- full %\u003e%\\n  ggplot(aes(Fare)) + \\n  geom_histogram(col    = \\\u0022yellow\\\u0022,\\n                 fill   = \\\u0022blue\\\u0022, \\n                 alpha  = .5) +\\n  ggtitle(\\\u0022Histogram of passengers Fare\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5, size = 15))\\n\\n# 생존여부에 따른 fare box plot\\nFare.p2 \u003c- full %\u003e%\\n  filter(!is.na(Survived)) %\u003e% \\n  ggplot(aes(Survived, Fare)) +  # x축에 생존 y축에 fare\\n  # 관측치를 회색점으로 찍되, 중복되는 부분은 퍼지게 그려줍니다.\\n  geom_jitter(col = \\\u0022gray\\\u0022) + \\n  # 상자그림 : 투명도 50% \\n  geom_boxplot(alpha = .5) + \\n  ggtitle(\\\u0022Boxplot of passengers Fare\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5, size = 15))\\n\\ngrid.arrange(Fare.p1,Fare.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002263abc287e36ada6edd2bbe8c8fbf3b6778a62d55\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.4 Age\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00220b683c6730c8d0fe40327c899c2a739be7c50f87\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022hist(full$Age)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022bd5f7ce139eb75cce8f782c7a2e4c707fabd8c00\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 나이 분포 히스토그램\\nage.p1 \u003c- full %\u003e% \\n  ggplot(aes(Age)) +     # x값에 따른 y값을 그리는 것이 아니므로 축 지정 안해줘도 됨 \\n  # 히스토그램 그리기, 설정\\n  geom_histogram(breaks = seq(0, 80, by = 1), # 간격 설정 \\n                 col    = \\\u0022red\\\u0022,              # 막대 경계선 색깔 \\n                 fill   = \\\u0022green\\\u0022,            # 막대 내부 색깔 \\n                 alpha  = .5) +               # 막대 투명도 = 50% \\n  # Plot title\\n  ggtitle(\\\u0022All Titanic passengers age hitogram\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022))\\n\\n# 나이에 따른 생존 분포 파악\\nage.p2 \u003c- full %\u003e% \\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(Age, fill = Survived)) + \\n  geom_density(alpha = .5) +   # 막대그래프가 아니고 밀도그래프니까 plot으로 축 지정하고 geom_bar 대신에 geom_density\\n  ggtitle(\\\u0022Titanic passengers age density plot\\\u0022) + \\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5,\\n                                  size = 15, color = \\\u0022darkblue\\\u0022))\\n\\ngrid.arrange(age.p1,age.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022faa70c8497a872ae857640ce3155d65087662e4f\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.5 Sibsp\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00227efd997c33d5027d4246c178955f6edbb0f2c0c2\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$SibSp)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223f4098594834ef2f0baf063da1b771db7ea49f1f\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, SibSp) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223de42135c1ea96eabac8e3b2eeb27321424eba85\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$SibSp,train$Survived),1) #배우자,형제자매가 많을수록 생존률이 떨어짐\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00225d06adfa0e1c84f9d9c3a8252b9a4f95b8cc5270\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.6 Parch\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226f41420e01a56f56fd69d91dd0ee02cbfd4eb290\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(train$Parch)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226cdc539c493a9bc810d5cf53eaa98d339521797e\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, Parch) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002271f402ebb08f0b12a19ade1e4255a3a2e3139acd\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$Parch,train$Survived),1) #부모와 자녀를 1~3명 정도 동승했을 경우 생존률이 높음 \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022561ef78e47b46e26bdaa0feb537eea0425d6f7af\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.7 Embarked\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022957d7678af3d3301d94ef11122e661ddbf269b15\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(train$Embarked) #결측값 2개\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022152dcf83c08cb7afd54676f3229b5285daf1b627\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, Embarked) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00228b967fd483649398862a136cc845dca20f6fc810\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$Embarked,train$Survived),1) # C에서 탑승한 인원들만 생존률이 더 높다\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022471d4f1b14eb0604694ed64ec6a2da2982b49f18\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 4. 결측치 처리\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022345652b8c0499bc69f56ed0cc1add043a0ecf3bd\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u00223.2 EDA 과정에서 결측치가 Cabin에 1014개, Age에 263개, Embarked 2개, Fare에 1개 존재한다는 것을 확인했다\u003cbr /\u003e\\nCabin은 결측치 수가 너무 많아서 그냥 변수를 제거하고, 차후 파생병수 Deck을 생성할 것이다\u003cbr /\u003e\\n따라서 Cabin 변수를 제외한 나머지 변수들에 대한 결측치 처리를 수행하려 한다\u003cbr /\u003e\\n\\nAge 결측처리는 5.feature engineering 과정에서 생성한 파생변수 title을 이용하여 처리하기 위해 5.4 Age feature engineering 과정에서 결측처리를 병행하도록 한다\u003cbr /\u003e\\n\\n따라서 해당 절에서는 Embarked 와 Fare의 결측처리를 우선 수행한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221c34ada6e01f8fb58c9ad3b7bfa90e7c93bec48b\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022colSums(is.na(full))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022fb2294a96b65c5bb2c992c02070e29e2b88af0f3\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 4.1 Embarked 결측처리\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022d12f51422d9af865263bd69a5920c5108ec73249\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full[is.na(full$Embarked), ] #두개의 관측치 모두 Fare가 80이고, Pclass가 1임\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002260d7974bb9f7c2bb2acbd80c662c49510f1b3c98\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022embark_fare \u003c- full[!is.na(full$Embarked), ]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c83c94274f5ec1442a92205584c98ed5458449d1\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022ggplot(embark_fare, aes(x = Embarked, y = Fare, fill = factor(Pclass))) +\\n  geom_boxplot() +\\n  geom_hline(aes(yintercept=80), # fare가 80에 line 생성\\n             colour=\u0027red\u0027, linetype=\u0027dashed\u0027, lwd=2) +\\n  scale_y_continuous()\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002229334d4260644e035f24db9a0c2a781b65582d4b\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022fare가 80면서 Pclass가 1인 승객들 대다수는 Embark가 C다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022f6cf9fb7c2c9358c3b5a11fbfde814051dd9e5aa\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Embarked[c(62, 830)] \u003c- \u0027C\u0027\\nfull[c(62, 830),] \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022be090e16f28b3f3fc024820fa27ad9fd668783cb\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 4.2 Fare 결측처리\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226dbbb20523558361433aa367d8b647ac34bb3f8c\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full  %\u003e% filter(is.na(full$Fare)) #Pclasss가 3이고, Embarked는 S임\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226bc0d41fb1cc9246d63eb33a2158e96ecaed7f5e\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Fare[1044] \u003c- median(full[full$Pclass == \u00273\u0027 \u0026 full$Embarked == \u0027S\u0027, ]$Fare, na.rm = TRUE) #중앙값으로 결측치 처리\\nfull[1044,]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00220bfb72edad59214b71f8cf377c13c786c76c5b49\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 5. Feature engineering\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00226ef51cbb2ba5668e7b6149653f76a95f0ad515e1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 5.1 Name\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00222d5375adfb8ddfd25bdcc275dd377c1e42dc8a59\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022Name에서 성별과 관련된 이름만을 추출하고 범주화해서 Title 파생변수를 생성한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022b41e23bdf53385ca253a47c958893d982f722828\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022Title \u003c- full$Name\\nTitle \u003c- gsub(\\\u0022^.*, (.*?)\\\\\\\\..*$\\\u0022, \\\u0022\\\\\\\\1\\\u0022, Title) # 정규표현식\\nfull$Title \u003c- Title\\nunique(full$Title)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022a7cbdff4871903da13d32c3abbc80d52a6482bfe\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022이 title이라는 파생변수를 그대로 사용할 경우 모델의(특히 Tree based model) 복잡도가 상당히 높아지기 때문에 범주를 줄여줘야한다.\\n그 전에 descr패키지를 이용해서 각 범주별 빈도수와 비율을 확인해보겠다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c9d5af417fabc8855d5af7f849b39dedfe8f1736\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 범주별 빈도수, 비율 확인 \\ndescr::CrossTable(full$Title)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022ade403c8aeffac285fccbf009ca0f8d56dd99451\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 5개 범주로 단순화 시키는 작업 \\nfull \u003c- full %\u003e%\\n  # \\\u0022%in%\\\u0022 대신 \\\u0022==\\\u0022을 사용하게되면 Recyling Rule 때문에 원하는대로 되지 않습니다.\\n  mutate(Title = ifelse(Title %in% c(\\\u0022Mlle\\\u0022, \\\u0022Ms\\\u0022, \\\u0022Lady\\\u0022, \\\u0022Dona\\\u0022), \\\u0022Miss\\\u0022, Title), # %in% 개념\\n         Title = ifelse(Title == \\\u0022Mme\\\u0022, \\\u0022Mrs\\\u0022, Title),\\n         Title = ifelse(Title %in% c(\\\u0022Capt\\\u0022, \\\u0022Col\\\u0022, \\\u0022Major\\\u0022, \\\u0022Dr\\\u0022, \\\u0022Rev\\\u0022, \\\u0022Don\\\u0022,\\n                                     \\\u0022Sir\\\u0022, \\\u0022the Countess\\\u0022, \\\u0022Jonkheer\\\u0022), \\\u0022Officer\\\u0022, Title),\\n         Title = factor(Title))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022294e8471224baeb42179651bb51f687c95fb3108\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 파생변수 생성 후 각 범주별 빈도수, 비율 확인 \\ndescr::CrossTable(full$Title) # 5개의 범주로 축소\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002290d90de2d3a25b2390afa82acb1a912d9052e69f\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022sour 0.5, label = Rank),\\n    hjust=0, vjust=0.55, size = 4, colour = \u0027red\u0027) +\\n  labs(x = \u0027Variables\u0027) +\\n  coord_flip()\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022405429b696dc75aa45a4097ba0ca51eb34d981ec\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prediction \u003c- predict(rf_model, test)\\n\\nsolution \u003c- data.frame(PassengerID = test$PassengerId, Survived = prediction)\\n\\n# write.csv(solution, file = \u0027rf_mod_Solution.csv\u0027, row.names = F)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022f01910ae5dcc8bd13049e81a986edb930320c705\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022rf_model\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022cb53d0349a2696e19b61ba7e0f2c5b9e607c0d7a\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 6.3 XGBOOST\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022f41fa3f4a3e9b030a34441f26299b59e7a912c5b\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 6.3.1 교차검증\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022392a68970076add52d48f1cab22ae7ce05db765e\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022library(caret)\\nlibrary(Matrix)\\nlibrary(xgboost)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00224d4b885453142bc22a973938ad469f0d5039f8d6\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train.control = trainControl(method = \\\u0022cv\\\u0022,\\n                              number = 5,\\n                              savePredictions = TRUE)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002224fd03f85e6c87463810abfab437cc50a83a2ab0\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022tune.grid = expand.grid(eta = c(0.075, 0.1),\\n                         nrounds = c(50, 100),\\n                         max_depth = 3:8,\\n                         min_child_weight = c(2.25, 2.5),\\n                         colsample_bytree = c(0.4, 0.5),\\n                         gamma = 0,\\n                         subsample = 1)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022scrolled\u0022:true,\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002276ce8b3a4bf651ab88b705c1c103c38457f6af93\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022tune.grid\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00225b8ed327c4c9f3e3088190e5a2b0e9e6de9602d3\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022caret.cv = train(Survived ~  Pclass + Sex + Age + Fare+Embarked + Title + Familysize+GroupSize, \\n                  data = train,\\n                  method = \\\u0022xgbTree\\\u0022,\\n                  tuneGrid = tune.grid,\\n                  trControl = train.control)\\npreds_XG = predict(caret.cv, test)\\nSurvivedXG = preds_XG\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022scrolled\u0022:true,\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022933be34bb8dfd12dec35e24c85c4b058b809644b\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022caret.cv$best\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022de7988891316d5353fb1d9f7b09233b022431dc5\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022caret.cv\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022a92b0c76b388615aae3a6022eb0c59146c60c119\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022caret.cv$finalModel\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022933041f8794dfda7aca720a1b3c9c9b081d74163\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 6.3.2 최종모델 생성\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002203a82e831ecf99f03611aa05aad6f062635c58c7\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full2=full  %\u003e%  select(-c(PassengerId,Name,SibSp,Parch,Ticket,Fsize,Deck,TravelGroup))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022bcd6b87cbf06bec0bdc01a7d76cef3c8225ec8d8\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train = full2[1:891,]\\ntest = full2[892:1309,]\\n\\ntrain$Survived=as.numeric(train$Survived)-1\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00224f287ab74ad2854ee4c4f9dd213d6842bc72a045\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022options(na.action=\u0027na.pass\u0027)\\ntrainm \u003c- sparse.model.matrix(Survived ~ ., data = train)\\ntrain_label \u003c- train$Survived\\ntrain_matrix \u003c- xgb.DMatrix(data = trainm, label=train_label)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221d00afa7b705c4b15a5b6205e92cfe7fbc1cd995\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022testm \u003c- sparse.model.matrix(Survived ~ ., data = test)\\ndtest \u003c- xgb.DMatrix(data = as.matrix(testm))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022e0013fa5c13fa09765d92445fb77258d9cc43f94\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022default_param\u003c-list(\\n        objective = \\\u0022binary:logistic\\\u0022,\\n        booster = \\\u0022gbtree\\\u0022,\\n        eta=0.075,\\n        gamma=0,\\n        max_depth=8, \\n        min_child_weight=2.25,\\n        subsample=1,\\n        colsample_bytree=0.5\\n)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022b2c6d852a263e1f6973b5af4eaa837e83cf6b48b\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022xgb.model=xgb.train(data=train_matrix,\\n                    params=default_param,\\n                    nrounds=100,\\n                    vedose=1)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002216a63f755bfc0baf72607ac344d8a1606799e077\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022XGB_pred \u003c- predict(xgb.model, dtest)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022422af6fa68870ed68c7d24c006bff1e3d84e7d5b\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022XGB_pred \u003c- ifelse(XGB_pred\u003e=0.5,1,0)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002224f077aa907b4d7a2bd290b45c6523289acba2ba\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# Get the trained model\\nmodel \u003c- xgb.dump(xgb.model, with_stats=TRUE)\\n\\n# Get the feature real names\\nnames \u003c- dimnames(train_matrix)[[2]]\\n\\n# Compute feature importance matrix\\nimportance_matrix \u003c- xgb.importance(names, model=xgb.model)[0:20] # View top 20 most important features\\n\\n# Plot\\nxgb.plot.importance(importance_matrix)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221426492e684be5ad549e659f8e61ce7007c301c4\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022test2 \u003c- full[892:1309,]\\nsolution \u003c- data.frame(PassengerID = test2$PassengerId, Survived = XGB_pred)\\n\\n# write.csv(solution, file = \u0027xg_mod_Solution.csv\u0027, row.names = F)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00229147aec94cbbe8fb6c062eaf04da5b373c9c0b46\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(prediction,XGB_pred)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]}],\u0022metadata\u0022:{\u0022kernelspec\u0022:{\u0022display_name\u0022:\u0022R\u0022,\u0022language\u0022:\u0022R\u0022,\u0022name\u0022:\u0022ir\u0022},\u0022language_info\u0022:{\u0022codemirror_mode\u0022:\u0022r\u0022,\u0022file_extension\u0022:\u0022.r\u0022,\u0022mimetype\u0022:\u0022text/x-r-source\u0022,\u0022name\u0022:\u0022R\u0022,\u0022pygments_lexer\u0022:\u0022r\u0022,\u0022version\u0022:\u00223.5.1\u0022}},\u0022nbformat\u0022:4,\u0022nbformat_minor\u0022:1}","dateCreated":"2019-03-25T14:35:02.9463019Z"},"kernelRun":{"id":12050244,"kernelId":3321483,"status":"complete","type":"batch","sourceType":"notebook","language":"r","title":"Titanic Analysis with R(rf,xgb)","dateCreated":"2019-03-25T14:35:03.023Z","dateEvaluated":"2019-03-25T14:35:03.417Z","workerContainerPort":null,"workerUptimeSeconds":187927,"workerIPAddress":"172.20.3.156   ","scriptLanguageId":12,"scriptLanguageName":"R Notebook HTML","renderedOutputUrl":"https://www.kaggleusercontent.com/kf/12050244/eyJhbGciOiJkaXIiLCJlbmMiOiJBMTI4Q0JDLUhTMjU2In0..8ICCN0H7nq-R7eQwc5sUwA.kKsCx8pipRWEwFV3fw-6gBD-G3YQrHB_r02vm-XtDiqOhPGDQwi0QituxcmyMue2FLfTR1HEVI0LSSpuMwElh7jDjysvSTqWVhzd5P26MyswOwv7PkI3LZa13lOvCJM5-bXbLInbls0X6O_MH7tUCx7FGvtXzucDeU1aiftwIKM.XEpzQ74X0Xhc_16C1KrR8g/__results__.html","commit":{"id":235670064,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"notebook","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"{\u0022cells\u0022:[{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002232c0c53cc9a41a8c2b73fd99403dc1be6fbe55d1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 타이타닉 분석\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022623bb09ab6e2734626a634acd8f55212d6aada9e\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 1. 소개\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022273f08d50d7921171ee8b24eb64d205abade5355\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 1.1 데이터 설명\\n* train.csv : 예측 모델을 만들기 위해 사용하는 학습 데이터다. 탑승객의 신상정보와 생존유무가 주어진다. \u003cbr /\u003e\\n* test.csv - 학습 데이터에서 신상정보 및 파생변수를 토대로 모델을 만들고 test.csv파일을 이용하여 생존유무를 예측한다. \u003cbr /\u003e\\n* sampleSubmission.csv - 제출시 사용하는 csv 파일이다. \u003cbr /\u003e\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022d14342756597070188502f7db172c60a0de7a2ce\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 1.2 변수 설명\\n* survival : 생존유무, target 값. (0 = 사망, 1 = 생존) \u003cbr /\u003e\\n* pclass : 티켓 클래스. (1 = 1st, 2 = 2nd, 3 = 3rd) \u003cbr /\u003e\\n* sex : 성별 \u003cbr /\u003e\\n* Age : 나이(세) \u003cbr /\u003e\\n* sibsp : 함께 탑승한 형제자매, 배우자 수 총합 \u003cbr /\u003e\\n* parch : 함께 탑승한 부모, 자녀 수 총합 \u003cbr /\u003e\\n* ticket : 티켓 넘버 \u003cbr /\u003e\\n* fare : 탑승 요금 \u003cbr /\u003e\\n* cabin : 객실 넘버 \u003cbr /\u003e\\n* embarked : 탑승 항구\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022a7d420e4ee4bfe8ab7abaa5bc4647a3937fbad6d\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 2. 준비작업\\n### 2.1 Packages\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00228caff423bee5b454f305b21b0556316f9c2c6c31\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022library(readr)\\nlibrary(stringr) # 문자열 처리 패키지\\nlibrary(doBy)\\nlibrary(ggplot2)\\nlibrary(scales)\\nlibrary(RColorBrewer)\\nlibrary(corrplot)\\nlibrary(doBy)\\nlibrary(dplyr) # 전처리\\nlibrary(randomForest)\\nlibrary(gridExtra)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002296514bf54e68ae0c8894bec7fb049a57ad862edc\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 2.2 Loading the data\\n\\nread.csv()보다 readr 패키지의 read_csv()가 조금 더 빨리 데이터를 읽어온다는 장점이 있다.\u003cbr /\u003e\\n그러나 read_csv()는 stringsAsFactors 옵션이 없어서 문자열(Character)과 요인(Factor)를 구별하지 못하고 모두 Character로 불러온다.\u003cbr /\u003e\\n\\n추가적으로 R에서 기본 내장함수 rbind()는 두 데이터의 차원이 같을 때 병합할 수 있는데 test셋에는 Y값이 없어서 차원이 다르다.\u003cbr /\u003e\\n이에 따라 dplyr::bind_rows()를 사용하여 test데이터의 Y값은 NA처리하며 병합한다.\\n\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002292e3eb150e2f8908288fa665e2746ed0436368a5\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train \u003c- read_csv(\u0027../input/train.csv\u0027)\\ntest \u003c- read_csv(\u0027../input/test.csv\u0027)\\nfull \u003c- bind_rows(train, test)\\n\\nfull \u003c- full %\u003e% # ticket과 cabin은 파생변수 생성을 위해 문자열로 놔둠\\n  mutate(Survived = factor(Survived),\\n         Pclass   = factor(Pclass, ordered = T),\\n         Name     = factor(Name),\\n         Sex      = factor(Sex),\\n         Embarked = factor(Embarked))\\n\\nstr(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022e7726ede378c3e7aaf72f6dd5e15a66c830249ff\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 3. 탐색적 데이터 분석(EDA)\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002254067df41b04f87aaafab2630ed4f2dd9120e5c1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.1 수치값을 활용한 data 확인\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221716a1d121ac811f36a1ce68849818170a0c71b6\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022head(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022fc65cab4badfdc75cbff4ca6c7503a1c06e68bc2\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022str(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022e7802a353a3e3258103e9bf13f289be8b2764a8c\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022summary(full)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00225c809ef81baa11e2a96f3d8ff6b21b08372707d2\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u00221. 사망자가 생존자보다 많다 \u003cbr /\u003e\\n2. 남성이 여성보다 2배 가까이 더 많다 \u003cbr /\u003e\\n3. SibSp의 3분위값이 1이므로 대부분 부부끼리 혹은 형제끼리 탑승했다 \u003cbr /\u003e\\n4. Parch의 3분위수가 0이므로 부모나 자녀와 함께 탑승한 승객이 많지 않다 \u003cbr /\u003e\\n5. Fare의 최대값이 512로 이상치가 아닌지 확인이 필요해 보인다 \u003cbr /\u003e\\n6. 결측치가 많은 데이터임을 확인할 수있다. \u003cbr /\u003e\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00222700a6ddfc06bf0c130c2c9c2bed407b244b68f5\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022sapply(train, function(x) length(unique(x)))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00221788d9cb2afed26ec29d8b780f73f4b1b481972d\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.2 결측치 확인 및 시각화\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022fa443208accede539ac696e3a54366e275a10fed\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022colSums(is.na(full))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226d34c768a25971ddfa841037602849fe7846ed20\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values \u003c- full %\u003e%      # 결측치 비율을 데이터프레임으로\\n  dplyr::summarize_all(funs(sum(is.na(.))/n()))\\n\\n# tidyr::gather()함수를 이용하여 stack화 시킴 (설명변수들이 key로 지정한 변수에 나열되고, 결측값들이 value로 지정한 변수의 값으로)\\nmissing_values \u003c- tidyr::gather(missing_values,\\n                                key = \\\u0022feature\\\u0022, value = \\\u0022missing_pct\\\u0022)\\nmissing_values\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022533983cdd85c248b09b26920bdbd211b90753ef7\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values %\u003e% \\n  ggplot(aes(x = reorder(feature, missing_pct), y = missing_pct)) + # 정렬을 위한 reorder() 축지정\\n  geom_bar(stat = \\\u0022identity\\\u0022, fill = \\\u0022red\\\u0022) +  # bar plot 그리기 stat = \u0027identity\u0027 데이터프레임 값을 그대로 이용하여 그리라는 옵션\\n  ggtitle(\\\u0022Rate of missing values in each features\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022)) +\\n  labs(x = \\\u0022Feature names\\\u0022, y = \\\u0022Rate\\\u0022) +  # x,y축 제목 지정\\n  coord_flip() # Plot의 x, y축 변환 \\n\\n# 결측값이 있는 변수로만 시각화\\nmissing_values \u003c- missing_values[missing_values$missing_pct \u003e 0, ]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022a7c5826356713fd97563379cd8f2a94296575c7d\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022missing_values \u003c- missing_values[missing_values$missing_pct \u003e 0, ]\\n\\nmissing_values %\u003e% \\n  ggplot(aes(x = reorder(feature, missing_pct), y = missing_pct)) + # 정렬을 위한 reorder() 축지정\\n  geom_bar(stat = \\\u0022identity\\\u0022, fill = \\\u0022red\\\u0022) +  # bar plot 그리기 stat = \u0027identity\u0027 데이터프레임 값을 그대로 이용하여 그리라는 옵션\\n  ggtitle(\\\u0022Rate of missing values in each features\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022)) +\\n  labs(x = \\\u0022Feature names\\\u0022, y = \\\u0022Rate\\\u0022) +  # x,y축 제목 지정\\n  coord_flip() # Plot의 x, y축 변환 \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00226651581fb95a6ce478e96b3cd3238979192da708\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 3.3 변수 EDA\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022649f5e37c9bb0eb585d2be407f2284d67777c234\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.1 Sex\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002267f938cbc34617f041f75174415e93800dc7e6f3\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$Sex)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226ebd48f3ec7bdf8e66354636788e5f1df5d9cdb3\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full %\u003e% group_by(Survived, Sex) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00225e95070d23b8b2f6feb6293751995541e270b70a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(full$Sex,full$Survived),1) #여자들이 생존할 확률이 높음\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002202c28c80403f5646b4f84a20761034a595d4cf6a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 성별 막대그래프\\nsex.p1 \u003c- full %\u003e% \\n  dplyr::group_by(Sex) %\u003e% \\n  summarize(N = n()) %\u003e% \\n  ggplot(aes(Sex, N)) +\\n  geom_col() +\\n  geom_text(aes(label = N), size = 5, vjust = 1.2, color = \\\u0022#FFFFFF\\\u0022) + \\n  ggtitle(\\\u0022Bar plot of Sex\\\u0022) +\\n  labs(x = \\\u0022Sex\\\u0022, y = \\\u0022Count\\\u0022)\\n\\n# 성별에 따른 생존률 막대그래프\\nsex.p2 \u003c- full%\u003e%\\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(factor(Sex), fill = factor(Survived))) +\\n  geom_bar(position = \\\u0022fill\\\u0022) + \\n  scale_y_continuous(labels = percent) +\\n  scale_fill_brewer(palette = \\\u0022Set1\\\u0022) +  # palette에 어떤색 넣을지 지정\\n   # 일정한 간격으로 x축과 y축 설정 : scale_x_continuous(breaks=seq())\\n  # 분석가 마음대로 x축과 y축 설정 : scale_x_continuous(breaks=c())\\n  ggtitle(\\\u0022Survival Rate by Sex\\\u0022) + \\n  labs(x = \\\u0022Sex\\\u0022, y = \\\u0022Rate\\\u0022)\\n\\ngrid.arrange(sex.p1,sex.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00229904db658f1b0414a133b15916946b43b0fd5bf4\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.2 Pclass\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223ec75b82d676c0646a50874e1523a879ee968763\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$Pclass)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c35146d06f00948f13ad927530a273b070aff355\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(full$Pclass,full$Survived),1) # 더 좋은 객실 이용자일수록 생존할 확률이 높음\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00220b24ec440aa5006bae11f781cbd3bee5ec5fa79a\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# Pclass 막대그래프\\npclass.p1 \u003c- full %\u003e% \\n  dplyr::group_by(Pclass) %\u003e% \\n  summarize(N = n()) %\u003e% \\n  ggplot(aes(Pclass, N)) +\\n  geom_col() +\\n  geom_text(aes(label = N), size = 5, vjust = 1.2, color = \\\u0022#FFFFFF\\\u0022) + \\n  ggtitle(\\\u0022Bar plot of Pclass\\\u0022) +\\n  labs(x = \\\u0022Pclass\\\u0022, y = \\\u0022Count\\\u0022)\\n\\n# Pclass에 따른 생존률 막대그래프\\npclass.p2 \u003c- full%\u003e%\\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(factor(Pclass), fill = factor(Survived))) +\\n  geom_bar(position = \\\u0022fill\\\u0022) + \\n  scale_fill_brewer(palette = \\\u0022Set1\\\u0022) +  \\n  ggtitle(\\\u0022Survival Rate by Pclass\\\u0022) + \\n  labs(x = \\\u0022Pclass\\\u0022, y = \\\u0022Rate\\\u0022)\\n\\ngrid.arrange(pclass.p1,pclass.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022cba644f5b2c83dafb3d048143ec6ba5a4f7d59c7\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.3 Fare\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221ed4e810e01eb836b000b9a51d580bd524260fac\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022hist(full$Fare)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c626947f9d91f9863323fd74c82261dab61ddbc8\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# fare 히스토그램\\nFare.p1 \u003c- full %\u003e%\\n  ggplot(aes(Fare)) + \\n  geom_histogram(col    = \\\u0022yellow\\\u0022,\\n                 fill   = \\\u0022blue\\\u0022, \\n                 alpha  = .5) +\\n  ggtitle(\\\u0022Histogram of passengers Fare\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5, size = 15))\\n\\n# 생존여부에 따른 fare box plot\\nFare.p2 \u003c- full %\u003e%\\n  filter(!is.na(Survived)) %\u003e% \\n  ggplot(aes(Survived, Fare)) +  # x축에 생존 y축에 fare\\n  # 관측치를 회색점으로 찍되, 중복되는 부분은 퍼지게 그려줍니다.\\n  geom_jitter(col = \\\u0022gray\\\u0022) + \\n  # 상자그림 : 투명도 50% \\n  geom_boxplot(alpha = .5) + \\n  ggtitle(\\\u0022Boxplot of passengers Fare\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5, size = 15))\\n\\ngrid.arrange(Fare.p1,Fare.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002263abc287e36ada6edd2bbe8c8fbf3b6778a62d55\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.4 Age\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00220b683c6730c8d0fe40327c899c2a739be7c50f87\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022hist(full$Age)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022bd5f7ce139eb75cce8f782c7a2e4c707fabd8c00\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 나이 분포 히스토그램\\nage.p1 \u003c- full %\u003e% \\n  ggplot(aes(Age)) +     # x값에 따른 y값을 그리는 것이 아니므로 축 지정 안해줘도 됨 \\n  # 히스토그램 그리기, 설정\\n  geom_histogram(breaks = seq(0, 80, by = 1), # 간격 설정 \\n                 col    = \\\u0022red\\\u0022,              # 막대 경계선 색깔 \\n                 fill   = \\\u0022green\\\u0022,            # 막대 내부 색깔 \\n                 alpha  = .5) +               # 막대 투명도 = 50% \\n  # Plot title\\n  ggtitle(\\\u0022All Titanic passengers age hitogram\\\u0022) +\\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022,    # 글씨체 \\n                                  hjust = 0.5,      # Horizon(가로비율) = 0.5\\n                                  size = 15, color = \\\u0022darkblue\\\u0022))\\n\\n# 나이에 따른 생존 분포 파악\\nage.p2 \u003c- full %\u003e% \\n  filter(!is.na(Survived)) %\u003e%\\n  ggplot(aes(Age, fill = Survived)) + \\n  geom_density(alpha = .5) +   # 막대그래프가 아니고 밀도그래프니까 plot으로 축 지정하고 geom_bar 대신에 geom_density\\n  ggtitle(\\\u0022Titanic passengers age density plot\\\u0022) + \\n  theme(plot.title = element_text(face = \\\u0022bold\\\u0022, hjust = 0.5,\\n                                  size = 15, color = \\\u0022darkblue\\\u0022))\\n\\ngrid.arrange(age.p1,age.p2,ncol=2)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022faa70c8497a872ae857640ce3155d65087662e4f\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.5 Sibsp\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00227efd997c33d5027d4246c178955f6edbb0f2c0c2\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(full$SibSp)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223f4098594834ef2f0baf063da1b771db7ea49f1f\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, SibSp) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223de42135c1ea96eabac8e3b2eeb27321424eba85\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$SibSp,train$Survived),1) #배우자,형제자매가 많을수록 생존률이 떨어짐\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00225d06adfa0e1c84f9d9c3a8252b9a4f95b8cc5270\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.6 Parch\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226f41420e01a56f56fd69d91dd0ee02cbfd4eb290\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(train$Parch)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226cdc539c493a9bc810d5cf53eaa98d339521797e\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, Parch) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002271f402ebb08f0b12a19ade1e4255a3a2e3139acd\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$Parch,train$Survived),1) #부모와 자녀를 1~3명 정도 동승했을 경우 생존률이 높음 \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022561ef78e47b46e26bdaa0feb537eea0425d6f7af\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022### 3.3.7 Embarked\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022957d7678af3d3301d94ef11122e661ddbf269b15\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022table(train$Embarked) #결측값 2개\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022152dcf83c08cb7afd54676f3229b5285daf1b627\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022train %\u003e% group_by(Survived, Embarked) %\u003e% summarise(freq = n())\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00228b967fd483649398862a136cc845dca20f6fc810\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022prop.table(table(train$Embarked,train$Survived),1) # C에서 탑승한 인원들만 생존률이 더 높다\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022471d4f1b14eb0604694ed64ec6a2da2982b49f18\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 4. 결측치 처리\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022345652b8c0499bc69f56ed0cc1add043a0ecf3bd\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u00223.2 EDA 과정에서 결측치가 Cabin에 1014개, Age에 263개, Embarked 2개, Fare에 1개 존재한다는 것을 확인했다\u003cbr /\u003e\\nCabin은 결측치 수가 너무 많아서 그냥 변수를 제거하고, 차후 파생병수 Deck을 생성할 것이다\u003cbr /\u003e\\n따라서 Cabin 변수를 제외한 나머지 변수들에 대한 결측치 처리를 수행하려 한다\u003cbr /\u003e\\n\\nAge 결측처리는 5.feature engineering 과정에서 생성한 파생변수 title을 이용하여 처리하기 위해 5.4 Age feature engineering 과정에서 결측처리를 병행하도록 한다\u003cbr /\u003e\\n\\n따라서 해당 절에서는 Embarked 와 Fare의 결측처리를 우선 수행한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221c34ada6e01f8fb58c9ad3b7bfa90e7c93bec48b\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022colSums(is.na(full))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022fb2294a96b65c5bb2c992c02070e29e2b88af0f3\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 4.1 Embarked 결측처리\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022d12f51422d9af865263bd69a5920c5108ec73249\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full[is.na(full$Embarked), ] #두개의 관측치 모두 Fare가 80이고, Pclass가 1임\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u002260d7974bb9f7c2bb2acbd80c662c49510f1b3c98\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022embark_fare \u003c- full[!is.na(full$Embarked), ]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c83c94274f5ec1442a92205584c98ed5458449d1\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022ggplot(embark_fare, aes(x = Embarked, y = Fare, fill = factor(Pclass))) +\\n  geom_boxplot() +\\n  geom_hline(aes(yintercept=80), # fare가 80에 line 생성\\n             colour=\u0027red\u0027, linetype=\u0027dashed\u0027, lwd=2) +\\n  scale_y_continuous()\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002229334d4260644e035f24db9a0c2a781b65582d4b\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022fare가 80면서 Pclass가 1인 승객들 대다수는 Embark가 C다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022f6cf9fb7c2c9358c3b5a11fbfde814051dd9e5aa\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Embarked[c(62, 830)] \u003c- \u0027C\u0027\\nfull[c(62, 830),] \u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022be090e16f28b3f3fc024820fa27ad9fd668783cb\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 4.2 Fare 결측처리\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226dbbb20523558361433aa367d8b647ac34bb3f8c\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full  %\u003e% filter(is.na(full$Fare)) #Pclasss가 3이고, Embarked는 S임\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00226bc0d41fb1cc9246d63eb33a2158e96ecaed7f5e\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Fare[1044] \u003c- median(full[full$Pclass == \u00273\u0027 \u0026 full$Embarked == \u0027S\u0027, ]$Fare, na.rm = TRUE) #중앙값으로 결측치 처리\\nfull[1044,]\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00220bfb72edad59214b71f8cf377c13c786c76c5b49\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022# 5. Feature engineering\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00226ef51cbb2ba5668e7b6149653f76a95f0ad515e1\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 5.1 Name\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00222d5375adfb8ddfd25bdcc275dd377c1e42dc8a59\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022Name에서 성별과 관련된 이름만을 추출하고 범주화해서 Title 파생변수를 생성한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022b41e23bdf53385ca253a47c958893d982f722828\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022Title \u003c- full$Name\\nTitle \u003c- gsub(\\\u0022^.*, (.*?)\\\\\\\\..*$\\\u0022, \\\u0022\\\\\\\\1\\\u0022, Title) # 정규표현식\\nfull$Title \u003c- Title\\nunique(full$Title)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022a7cbdff4871903da13d32c3abbc80d52a6482bfe\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022이 title이라는 파생변수를 그대로 사용할 경우 모델의(특히 Tree based model) 복잡도가 상당히 높아지기 때문에 범주를 줄여줘야한다.\\n그 전에 descr패키지를 이용해서 각 범주별 빈도수와 비율을 확인해보겠다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022c9d5af417fabc8855d5af7f849b39dedfe8f1736\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 범주별 빈도수, 비율 확인 \\ndescr::CrossTable(full$Title)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022ade403c8aeffac285fccbf009ca0f8d56dd99451\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 5개 범주로 단순화 시키는 작업 \\nfull \u003c- full %\u003e%\\n  # \\\u0022%in%\\\u0022 대신 \\\u0022==\\\u0022을 사용하게되면 Recyling Rule 때문에 원하는대로 되지 않습니다.\\n  mutate(Title = ifelse(Title %in% c(\\\u0022Mlle\\\u0022, \\\u0022Ms\\\u0022, \\\u0022Lady\\\u0022, \\\u0022Dona\\\u0022), \\\u0022Miss\\\u0022, Title), # %in% 개념\\n         Title = ifelse(Title == \\\u0022Mme\\\u0022, \\\u0022Mrs\\\u0022, Title),\\n         Title = ifelse(Title %in% c(\\\u0022Capt\\\u0022, \\\u0022Col\\\u0022, \\\u0022Major\\\u0022, \\\u0022Dr\\\u0022, \\\u0022Rev\\\u0022, \\\u0022Don\\\u0022,\\n                                     \\\u0022Sir\\\u0022, \\\u0022the Countess\\\u0022, \\\u0022Jonkheer\\\u0022), \\\u0022Officer\\\u0022, Title),\\n         Title = factor(Title))\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022294e8471224baeb42179651bb51f687c95fb3108\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# 파생변수 생성 후 각 범주별 빈도수, 비율 확인 \\ndescr::CrossTable(full$Title) # 5개의 범주로 축소\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u002290d90de2d3a25b2390afa82acb1a912d9052e69f\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 5.2 Sex\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022d1127aa9d06be85d9c64405ab11d5b0e72c838bc\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022성별을 더미화한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00221ad4e6356cdb93dad7d929b19293551ec4c18311\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Sex \u003c- ifelse(full$Sex == \\\u0022male\\\u0022 ,0 , 1)\\nfull$Sex \u003c- as.factor(full$Sex)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u0022a0058683c746ef3d3f90357fd4fdd72b59046a44\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022## 5.3 Fsize\u0022},{\u0022metadata\u0022:{\u0022_uuid\u0022:\u00223d113ee95d4e9f1808c6ade0535ad541179ea0ac\u0022},\u0022cell_type\u0022:\u0022markdown\u0022,\u0022source\u0022:\u0022Sibsp와 Parch를 이용하여 Fsize 파생변수를 생성한다\u0022},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u0022b08905723593513066b7bcd366e9e44d520fdbf4\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022full$Fsize \u003c- full$SibSp + full$Parch + 1\\ntable(full$Fsize)\u0022,\u0022execution_count\u0022:null,\u0022outputs\u0022:[]},{\u0022metadata\u0022:{\u0022trusted\u0022:true,\u0022_uuid\u0022:\u00223d42211a85e124f8bc7d6aab282d85a5c54c7454\u0022},\u0022cell_type\u0022:\u0022code\u0022,\u0022source\u0022:\u0022# bFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the “ground truth”) for each passenger. Your model will be based on “features” like passengers’ gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancés were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":12050244,"kernelVersionId":null,"isForkParent":false,"isNotebook":true,"languageName":"R","lastRunTime":"2019-03-25T14:35:03.023Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":63,"linesInsertedFromPrevious":154,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:de4f370f1c8566af1a0041cd933504f99f8466c49e5580d78b6b9d765f2b9fc6","dockerImageName":"gcr.io/kaggle-images/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":45.6039740639972,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Titanic Analysis with R(rf,xgb)","url":"/pyy0715/titanic-analysis-with-r-rf-xgb?scriptVersionId=12050244","versionNumber":2,"hasVersionNumber":true,"isRedacted":false,"versionAuthor":{"avatarThumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/2508358-kg.jpg","displayName":"pyy0715","userName":"pyy0715","profileUrl":"/pyy0715","tier":"Novice","tierInt":0,"userId":2508358}},{"id":11832190,"kernelVersionId":null,"isForkParent":false,"isNotebook":true,"languageName":"R","lastRunTime":"2019-03-20T10:14:18.4Z","linesChangedFromPrevious":0,"lines
